About: Remember the hit, &quot;Crossing Over&quot; from 1991? My guess is that the producers had some left-over film footage of Moana they wanted to use, so they inserted it into a story that has Marc Wallice as a detective, and Fantasia as his assistant. The opening triad with Moana, Jon Dough and Marc is average (even with a DP in it), but has no live sound whatsoever; just background music. Next, comes a segue as we are suddenly transported to Fantasia's apartment, where she and lover Francesca Le do a double lick. After an inexplicable film clip of Moana, we finally reach this film's highlight: Marc and Meekah, who do the nasty with fervor and style, even adding a little &quot;rear entry&quot; for variety. The tape ender with Marc and Fantasia lacks the passion necessary to make it sizzle
